import { makeStyles, Theme, createStyles } from "@material-ui/core";

export const useTitleStyles = makeStyles((theme: Theme) =>
  createStyles({
    box: {
      padding: 10,
      minWidth: 350,
    },
    buttons: {
        padding: 10,
    },
    error: {
        color: theme.palette.error.main
    },
    good: {
        color: theme.palette.primary.main
    }
  }),
)
